INSERT INTO `review` VALUES (40,48,35,5,'A must have in your CS Library.','Indeed one of the best books I have bought for Linux starters.','2023-04-18 07:44:03'),(41,58,35,4,'Excellent from start to finished.','Looking for a page turner, well you\'ve found it. This is a book that will keep you engaged until you finish it. Then you will be searching for the sequel. Enjoy.','2023-04-18 07:45:13'),(42,60,35,4,'Good','Loneliness is brought over from France, the pain of the wound from the Middle East. For Men Without Women, the world is a vast, poignant mix, very much the far side of the moon.','2023-04-18 08:06:43'),(43,60,35,5,'impression','Howâs this for blurbs: when the female author published this collection of short stories at age 32 in 1999, she won the Pulitzer Prize, the Pen/Hemingway Award and the New Yorkerâs Debut Book of the Year. ','2023-04-18 08:08:37'),(44,61,35,5,'Very good to read','The stories in Carmen Maria Machadoâs Her Body and Other Parties vibrate with originality, queerness, sensuality and the strange. Her voracious imagination and extraordinary voice beautifully bind these stories about fading women and the end of the world and men who want more when theyâve been given everything and bodies, so many human bodies taking up space and straining the seams of skin in impossible, imperfect, unforgettable ways.','2023-04-18 08:09:48'),(45,49,35,5,'Extremely well thought of, gem of book','The book teaches you how to decompose and solve problems efficiently using microservices using golang.\r\nIt showcases both how intelligently the language is designed (how easy it is to import for example a database, for a small part of platform, or a message queue for another) and also how good abstractions allow you to tackle complexity while maintaining proper code form.','2023-04-18 08:38:20'),(46,51,35,4,'Very basic','Primer may be the relevant word in the title; the book is ~120 pages long, and about half is code listings, so about 60 pages which are at a level like \"what is a database\". Most code is just listings, and it is small pages and large print - so about a 30-40 page equivalent, typically what one might find in an introductory chapter of a more technical book.','2023-04-18 08:39:43'),(47,50,35,5,'Concrete, Actionable Advice','This book has some of the simplest, clearest, and most actionable guidelines for writing high-quality code I have ever read. It\'s not very in-depth, but it provides solid targets to shoot for when trying to implement lessons from more general and in depth sources such as (for example) Code Complete.','2023-04-18 09:23:54'),(48,60,35,5,'Review','My Review','2023-04-19 01:12:30');
/*!40000 ALTER TABLE `review` ENABLE KEYS */;
